Let the center of the circle be O and the chord be AB. 

[asy]
unitsize(1.5 cm);

pair A, B, O;

O = (0,0);
A = dir(135);
B = dir(45);

draw(Circle(O,5));
draw(A--B);

label("$A$", A, NW);
label("$B$", B, NE);
label("$O$", O, SW);
[/asy]

We can use the following formula:

**Distance from a point to the center of a circle =  √((radius)^2 - (distance from point to the circle)^2)**

In this case:

* Radius (r) = 5 units
* Distance from point A to the center (OA) =  √((5)^2 - (12)^2) = √(25 - 144) = √(-119)

Since the square root of a negative number is not a real number, this problem has no solution. 


**Explanation:**

The distance from a point on a circle to its center is always a positive value. The given problem has an impossible scenario where the distance from the point to the center is negative.
